package LeetCode;

import java.lang.reflect.Array;

public class StringRough {

    //Time Limit Exceeded
    public boolean validPalindrome1(String s) {
        StringBuilder builder1=new StringBuilder(s);
        StringBuilder builder2=new StringBuilder(s).reverse();
        if(builder1.compareTo(builder2)==0){
            return true;
        }
        for(int i=0;i<s.length();i++){
            builder1=new StringBuilder(s);
            builder2=new StringBuilder(s);
            builder1.deleteCharAt(i);
            builder2.deleteCharAt(i);
            builder2=builder2.reverse();
            if(builder1.compareTo(builder2)==0){
                return true;
            }
        }
        return false;
    }

    public boolean validPalindrome2(String s){
        int left=0;
        int right=s.length()-1;
        while(left<right){
            if(s.charAt(left)!=s.charAt(right)){
                return skipPalindrome(s,left+1,right) ||  skipPalindrome(s,left,right-1);
            }
            left++;
            right--;
        }
        return true;
    }

    public boolean skipPalindrome(String s,int left,int right){
        while(left<right){
            if(s.charAt(left)!=s.charAt(right)){
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    public static void main(String[] args) {
        StringRough s=new StringRough();
//        System.out.println(s.validPalindrome1(""));
        System.out.println(s.validPalindrome2(""));
    }
}
